import React from "react";
import "./style.module.css";
import pic from "./Login.jpg";
import backgroundpic from "./Nature.png";

function App() {
  return (
    <div className="App">
      <img src={pic} alt="Trading Clothes" width={325} height={475}
       style ={{position: 'absolute', top:150, left:235}}></img>
      <img src={backgroundpic} width={500} height={800}
        style = {{position: 'absolute', top: 0, left: 0}}></img>
    </div>
  );
}

export default App;
